import { Layout } from "../components/Layout";
import { Typography } from "@material-ui/core";
import { MyFooter } from "../components/common/myFooter";

function IndexPage() {
  return (
    <Layout title="Login">
      <Typography>Hello World</Typography>
      <MyFooter />
    </Layout>
  );
}

export default IndexPage;
